import React from "react";
import {Strong, Card } from "react-bootstrap";

function Jobs({ job }) {
  return (
    <Card className="my-3 p-3 round">
      <a href={"job/${job.Id}"}></a>
      <Card.Body>
        <a href={"job/${job.Id}"}>
          <Card.Title as="div">
            <Strong> {job.JobTitle} </Strong>
          </Card.Title>
        </a>
      </Card.Body>
    </Card>
  );
}

export default Jobs;
